precision = thisComp.frameDuration;
var result = value;
function worldVelocity(temps) {
    var worldVelocityX, worldVelocityY;
    worldVelocityX = mul(sub(thisLayer.toWorld(thisLayer.anchorPoint, temps)[0], thisLayer.toWorld(thisLayer.anchorPoint, sub(temps, 0.01))[0]), 100);
